    false,nt"url": null,nt"notes": "In 2002, the City of San Diego (City) received
    funding through a U. S. Fish and Wildlife Service (USFWS) Section 6 Planning Grant
    to complete an inventory and management plan of vernal pools within the Cityu2019s
    jurisdiction. This inventory (performed during 2003) builds on several previous
    studies and surveys, which were used to determine the general locations of individual
    vernal pools and complexes. However, much of the area currently owned by the City
    and other jurisdictions has never been surveyed for specific vernal pools and, in
    many cases, historical maps do not accurately represent the existing basins. This
    inventory focuses on these areas. This inventory does not, however, include vernal
    pools known to occur on military lands (i.e., MCAS Miramar, Navy Chollas Heights)
    within the City but not under City jurisdiction. A comprehensive vernal pool plant
    survey has been completed for each complex within the City. City staff estimated
    percent cover for the six vernal pool species listed as endangered or threatened
    by the state and/or federal government, or considered covered (i.e. adequately conserved)
    by the Multiple Species Conservation Program (MSCP).",nt"owner_org": "467d900f-8a42-452d-9906-6610dd1a767f",nt"extras":
